import Link from 'next/link';

class Results extends React.Component {
  constructor(props) {
    super(props);


    }
  render () {
      return (
        <React.Fragment>
        <h1>Results</h1>

      <ul>
      {this.props.results.episodes.map(episode => (
        <li key={episode.id}>
          <Link href="/episode/[eid]" as={`/episode/${episode.id}`}>
            <a>{episode.name}</a>
          </Link>
        </li>
      ))}

    </ul>

    </React.Fragment>
      );
    }
  }

  export default Results;
